import React from 'react';
import {Navbar,Container} from 'react-bootstrap';

const navbar = () => {
  return (
    <div>
      <Navbar expand="lg" className='bg-primary justify-content-between'>
   
        <Container className=''>
        <Navbar.Toggle className='ms-auto' style={{justifyContent:"end",justifyItems:"end"}}/>
        <Navbar.Collapse id="basic-navbar-nav">
          <ul style={{display:"flex",listStyle:"none"}}>
          <li> Home</li>
           
          <li> Home</li>
          <li> Home</li>
            ABOUT
      
        
            CONTACT
        
          </ul>
          </Navbar.Collapse>
        </Container>
   
      </Navbar>
    </div>
  )
}

export default navbar;
